#!/usr/bin/env python3
"""
Maximum Sum Circular Subarray

Given a circular array C of integers represented by A, find the maximum possible sum of a non-empty subarray of C.

Here, a circular array means the end of the array connects to the beginning of the array.  (Formally, C[i] = A[i] when 0 <= i < A.length, and C[i+A.length] = C[i] when i >= 0.)

Also, a subarray may only include each element of the fixed buffer A at most once.  (Formally, for a subarray C[i], C[i+1], ..., C[j], there does not exist i <= k1, k2 <= j with k1 % A.length = k2 % A.length.)
"""

class Solution:
    def kadane(self, A) -> int:
        max_sum = this_sum = A[0]
        for i in range(1, len(A)):
            if this_sum < 0:
                this_sum = A[i]
            else:
                this_sum += A[i]
            max_sum = max(max_sum, this_sum)
        return max_sum

    def maxSubarraySumCircular(self, A) -> int:
        k = self.kadane(A)
        if k < 0:
            return k
        return max(k, sum(A) + self.kadane([-a for a in A]))


d = [5, -3, 5]
print("Solution", d, Solution().maxSubarraySumCircular(d))

d = [-3,-5,-2,-5,-6]
print("Solution", d, Solution().maxSubarraySumCircular(d))

d = [2,-2,2,7,8,0]
print("Solution", d, Solution().maxSubarraySumCircular(d))

d = [8,-1,-3,8,-6,-9,2,4]
print("Solution", d, Solution().maxSubarraySumCircular(d))


d = [-5,-2,5,6,-2,-7,0,2,8]
print("\n\n\n\nSolution", d)
print("Solution", d, Solution().maxSubarraySumCircular(d))

